import React from 'react'
import './style.css'

function Header () {
    return (
        <header>MILA
            <div id="nunc">{ `{ mee-luh }` }</div>
                <div className="contactLink">
                <a href="contact" id="contact">Contact</a></div>
                <div className="loginLink">
                <a href="#login" id="login">Login</a></div>
        </header>
    )
}

// function doStuff(str) {
